class Solution:
    
    def lengthOfLongestSubstring(self, s: str) -> int:
        
        substr = set()
        for i in range(len(s)):
            temp = s[i]
            for j in range (i+1, len(s)):
                
                if s[j] in temp:
                    substr.add(temp)
                    temp = s[j]
                    break
                else:
                    temp = temp+s[j]
                
            substr.add(temp)
        
        max_len = 0
        
        for st in substr:
            if len(st) > max_len:
                max_len = len(st)
                
        return max_len
    
